pragma solidity 0.8.10;
import {IERC721} from '@openzeppelin/contracts/token/ERC721/IERC721.sol';
import '@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol';
import '@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol';

import '../interfaces/ITransferAdapterNFT.sol';

contract TransferAdapterERC721Default is ERC721Holder, ERC1155Holder, ITransferAdapterNFT {
    address public immutable OpenSkyBespokeMarket;

    constructor(address address_) {
        OpenSkyBespokeMarket = address_;
    }

    function transferNFTIn(
        address collection,
        address from,
        uint256 tokenId,
        uint256 amount
    ) public {
        require(msg.sender == OpenSkyBespokeMarket, 'BP_ACL_ONLY_OPENSKYBESPOKEMARKET_CAN_ALL');

        IERC721(collection).safeTransferFrom(from, address(this), tokenId);
    }

    function transferNFTOut(
        address collection,
        address to,
        uint256 tokenId,
        uint256 amount
    ) public {
        require(msg.sender == OpenSkyBespokeMarket, 'BP_ACL_ONLY_OPENSKYBESPOKEMARKET_CAN_ALL');

        IERC721(collection).safeTransferFrom(address(this), to, tokenId);
    }
}
